function Form1({ values }) {
  const { step, setStep, emp, initial, setEmp } = values;
  return (
    <Formik
      initialValues={initial}
      // validationSchema={validationSchemas[0]}
      onSubmit={async (values, { setErrors }) => {
        //console.log(values);
        setErrors({});
        setEmp({ ...emp, ...values });

        if (step <= 5) return setStep((prev) => prev + 1);
      }}
    >
      {({
        handleSubmit,
        handleChange,
        setFieldTouched,
        values,
        errors,
        touched,
      }) => (
        <Form onSubmit={handleSubmit} autoComplete="off">
          <div style={{ height: 250, maxHeight: 400, overflowX: "hidden" }}>
            <Grid container spacing={2}>
              <Grid
                item
                xs={12}
                display={"flex"}
                style={{ marginTop: 10, width: "60%" }}
                alignItems={"center"}
                justifyContent={"center"}
              >
                <Typography style={{ marginRight: "10px" }}>I'm a</Typography>
                {/* <FormFieldInput  fullWidth  name='current_title' type='text'variant="outlined" label="Title" /> */}
                <div className="d-flex  flex-column">
                  <FormControl sx={{ m: 1, width: "25ch" }} variant="outlined">
                    <InputLabel
                      htmlFor="outlined-adornment-password"
                      name="current_title"
                      required
                    >
                      Title{" "}
                    </InputLabel>
                    <OutlinedInput
                      id="outlined-adornment-password"
                      onBlur={() => setFieldTouched("current_title")}
                      onChange={handleChange("current_title")}
                      endAdornment={
                        <InputAdornment
                          position="end"
                          style={{ cursor: "pointer" }}
                        >
                          {/* <IconButton
                  edge="end"
                  title="Your position, designation or job title etc"
                >
                   <InfoIcon/> 
                </IconButton> */}
                          <HtmlTooltip
                            title={
                              <React.Fragment>
                                <Typography color="inherit">
                                  Your position, designation or job title etc
                                </Typography>
                              </React.Fragment>
                            }
                          >
                            <InfoIcon />
                          </HtmlTooltip>
                        </InputAdornment>
                      }
                      label="Title"
                    />
                  </FormControl>

                  <AppErrorMessage name={"current_title"} />
                </div>
              </Grid>

              <Grid
                item
                xs={12}
                spacing={2}
                display={"flex"}
                alignItems={"center"}
                justifyContent={"center"}
                title="your interest"
              >
                <Typography style={{ marginRight: "10px" }}>
                  Interested in:
                </Typography>
                <FormControl>
                  <RadioGroup
                    row
                    required
                    aria-labelledby="demo-row-radio-buttons-group-label"
                    name="interest"
                    defaultValue={"CON"}
                    onBlur={() => setFieldTouched("interest")}
                    onChange={handleChange("interest")}
                  >
                    <FormControlLabel
                      value="CON"
                      control={<Radio />}
                      label="Flexiable on demand"
                    />
                    {/*
                    <FormControlLabel
                  value="PRM"
                  control={<Radio />}
                  label="Per Diem Staffing"
                />
                    <FormControlLabel
                      value="CON"
                      control={<Radio />}
                      label="Flexiable on demand"
                    />
                    <FormControlLabel
                      value="CTP"
                      control={<Radio />}
                      label="Temp to Hire"
                    />
                    <FormControlLabel
                      value="PRM"
                      control={<Radio />}
                      label="Permanent Placement"
                    />
                    */ }

                  </RadioGroup>
                </FormControl>
              </Grid>
            </Grid>
          </div>

          <ButtonHandlers values={{ step, setStep, handleSubmit }} />
        </Form>
      )}
    </Formik>
  );
}
function Form2({ values }) {
  const { step, setStep, initial, emp, setEmp } = values;
  return (
    <Formik
      initialValues={initial}
      // validationSchema={validationSchemas[1]}
      onSubmit={async (values, { setErrors }) => {
        //console.log(values);
        setErrors({});
        setEmp({ ...emp, ...values });

        if (step <= 5) return setStep((prev) => prev + 1);
      }}
    >
      {({
        handleSubmit,
        setFieldValue,
        handleChange,
        setFieldTouched,
        values,
        errors,
        touched,
      }) => (
        <Form onSubmit={handleSubmit} autoComplete="off">
          <Grid container spacing={2} className=" p-3">
            <Grid item xs={12} display={"flex"} className="gap-3">
              <FormFieldInput
                containerClass={"w-100"}
                fullWidth
                name="first_name"
                type="text"
                label="First Name"
                title="Enter your first name"
              />
              <FormFieldInput
                containerClass={"w-100"}
                fullWidth
                name="last_name"
                type="text"
                label="Last Name"
                title="Enter your last name"
              />
            </Grid>





            <Grid item xs={12} display={"flex"} className="gap-3">
              <FormFieldInput
                containerClass={"w-100"}
                fullWidth
                name="email"
                type="email"
                label="Email"
                title="Enter your email "
              />
              <FormFieldInput
                containerClass={"w-100"}
                fullWidth
                name="confirm_email"
                type="email"
                label="Confirm Email"
                title="confirm your email "
